%JENV     Set the Java Runtime Environment path for MATLAB
%
%  [JavaEnvironment] = JENV returns a matlab.javaclient.JavaEnvironment
%  object, which contains details about the current Java Environment
%
%  [JavaEnvironment] = JENV('system') changes the default Java version
%  to system installed Java version but MATLAB requires restart to
%  update the version of Java.
%
%  [JavaEnvironment] = JENV('factory') changes back to default Java version
%  but MATLAB requires to restart
%
%  [JavaEnvironment] = JENV('<jre_path>') user provided <jre_path> will be used
%  by MATLAB
%
%  [JavaEnvironment] = JENV('-clear') will remove the JRE configuration for an
%  individual user.
%
%  [JavaEnvironment] = JENV('-allusers','system/factory/<jre_path') changes the
%  Java setting value for all users.
%
%  [JavaEnvironment] = JENV('-allusers','-clear') It will remove the JRE
%  configuration for each MATLAB installation for all users.

